import React, { Component } from 'react';
import './SignIn.scss';
import TextField from '@mui/material/TextField';
import Button from '@mui/material/Button';
import { styled } from '@mui/system';


// $accent-color: linear-gradient(90deg,#ed145b 0,#7b31f4);
const MyComponent = styled(TextField)({
  width: '100%',
              marginBottom: '25px',
              '& > .MuiFilledInput-root': {
                '&:hover:before': {
                  borderBottom: '2px solid #e00bcb !important',
                } 
              }
           
})

class SignIn extends Component {
  constructor(props) {
    super(props);
    this.state = {
      Email: '',
      password: ''
    }
  }

  handelChange = (event) => {
    const { Email, password } = event.targe
  }

  render() {
    return (
      <div className='sign-in'>
        <h1 className='sign-in-title'>Sign in</h1>
        <form className="signin-form" noValidate autoComplete='off'>
          <div className='signin-form-email-area'>
            <MyComponent    
                id="filled-basic" 
                label="Email" 
                variant="filled"
                required
                onChange={(event) => this.setState({Email: event.target.value}, () => console.log(event))}
              />
          </div>
          <div className='signin-form-password-area'> 
            <MyComponent    
              id="filled-basic" 
              label="password" 
              variant="filled"
              required
            />
          </div>
          <div className='signin-form-button'>
          <Button
            sx={{
              marginTop: '50px',
              borderRadius: '0px',
              backgroundColor: 'rgba(224, 11, 203, 1)',
              '&:hover': {
                backgroundColor: 'black',
              }
            }}
            variant="contained" 
            size="large"
          >
            Sign In
          </Button>    
          </div>
            
        </form>
      </div>
    )
  }
  
}

export default SignIn;
